    "The model with PCA achieved an accuracy of 87.18%, while the model without PCA achieved a higher accuracy of 94.87%. This difference of 7.69% may be due to the dimensionality reduction effect of PCA and led to information loss. There is potential for improvement and hyperparameter tuning using RandomizedSearchCV may be beneficial."
