    "Oh that is interesting. Both the models ended with the same accuracy score as one increased from 87.17 to 92.31 the other decreased from 94.87 to 92.31. Is that even possible for The RandomizedSearchCV process to findd optimal hyperparameters that allow both models to achieve the same level of performance, regardless of the input features?"
